import React from 'react'
import { useTranslation } from "react-i18next";
import I18n from '../I18n';

function Home() {

  const { t } = useTranslation();

  return (
    <div className="App">
    <div className="App-header">
      <h1>{t('home')}</h1>
      <h2>
        <I18n t="homePage.title" />
      </h2>
      <p>
        <I18n t="homePage.text" />
      </p>

    </div>
  </div>
  )
}

export default Home
